import SelectProductCategory from '../../../components/home/header/SelectProductCategory';
import NavLink from "../../../components/home/header/NavMenuLink";
import Box from "@mui/material/Box";

const SelectProductCategoryContainer = () => {
  const handleChange = (e, setProductCategory) => {
    setProductCategory(e.target.value);
  };

  const linksContainerStyle = {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  };

  const values = [
    'All Categories',
    'Fruits',
    'Vegetables',
    'Cucumber',
    'Coco Cookies',
  ];

  const navLinks = {
    'All Categories': '/home',
    'Vegetables': '/home/vegetables',
    // 'Most popular': '/most-popular',
    // 'Deal of the Day': '/deal-of-the-day',
    // 'Contact Us': '/contact-us',
  };

  return (
      // <SelectProductCategory handleChange={handleChange} values={values} />
      <Box sx={linksContainerStyle}>
    {Object.entries(navLinks).map(([link, to]) => (
        <NavLink key={link} link={link} to={to} />
    ))}
  </Box>
  );
};

export default SelectProductCategoryContainer;
